import axios from "axios";
import { applyMiddleware, createStore } from "redux";
import { thunk } from "redux-thunk";


const abc = {
    loading: false,
    data: null,
    err: null,
}


function Reducer(state = abc, action) {
    switch (action.type) {
        case "insert":
            return {
                ...state,
                loading: true
            }
            break;
        case "insert done":
            return {
                ...state,
                loading: false,
                data: action.payload
            }
            break;
        case "insert fail":
            return {
                ...state,
                loading: false,
                err: action.payload
            }
            break;

        default:
            return state
            break;
    }
}


function insert(name, email, subject, number, massage) {
    return async (dispatch) => {
        dispatch({
            type: "Start"
        })
        try {

            var a = await axios.post("https://g-b9eg.onrender.com/inquiry", {name, email, subject, number, massage})

            dispatch({
                type: "insert",
            })

        } catch (error) {
            dispatch({
                type: "fail",
                payload: error
            })
        }
    }
}


const Store = createStore(Reducer, applyMiddleware(thunk))


export { Store, insert };
